import React, { Component } from 'react';
import ListCoursesComponent from './ListCoursesComponent';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import CourseComponent from './CourseComponent';
import UserComponent from './UserComponent';
import ListUsersComponent from './ListUsersComponent';
import AddUserComponent from './AddUserComponent';

class InstructorApp extends Component {
    render() {
        return (
            <Router>
                <>
                    <h1>Users/Activities Application</h1>
                    <Switch>
                        <Route path="/courses/:id/addUser/:idUser" exact component={AddUserComponent} />
                        <Route path="/courses/:id/addUser" exact component={AddUserComponent} />
                        <Route path="/users" exact component={ListUsersComponent} />
                        <Route path="/user" exact component={UserComponent} />
                        <Route path="/users/:id" exact component={UserComponent} />
                        <Route path="/" exact component={ListCoursesComponent} />
                        <Route path="/courses" exact component={ListCoursesComponent} />
                        <Route path="/courses/:id" component={CourseComponent} />
                    </Switch>
                </>
            </Router>
        )
    }
}

export default InstructorApp
